import React from "react";
import {
  FormControl,
  TextField,
  Typography,
  Button,
  Link,
  FormHelperText,
} from "@mui/material";

const SignUp = () => {

  return (
    <>

        <div className="container">
          <div>
            <Typography variant="h3">SignUp Form</Typography>
            <TextField label="First Name" required />
          </div>
        </div>

    </>
  );
};
export default SignUp;
